  "อิสฺสาปกต": "ว. ผู้อันความริษยากระทำทั่วแล้ว อิต. แจกเหมือน กญฺญา เช่น ทุ.เอก. อิสฺสาปกตํ (อิตฺถึ) ซึ่งหญิง ผู้อันความริษยากระทำทั่วแล้ว เป็นตติยาตัปปุริสสมาส วิ.ว่า อิสฺสาย ปกตา = อิสฺสาปกตา (อิตฺถี) คำว่า ปกต มาจาก ป บทหน้า + กร ธาตุ ในความทำ + ต ปัจจัย ลบ ร ที่สุดธาตุ ได้รูปเป็น ปกต ดู อกต",
  "อิสฺสาปกตอิตฺถีวตฺถุ": "น., นปุ. อ. เรื่องแห่งหญิง ผู้อันความริษยากระทำทั่วแล้ว เป็นฉัฏฐี ตัปปุริสสมาส มีตติยาตัปปุริสสมาส และวิเสสนบุพพบท กัมมธารยสมาส เป็นภายใน มีวิเคราะห์ ตามลำดับ ดังนี้ ต.ตัป.วิ. อิสฺสาย ปกตา = อิสฺสาปกตา (อิตฺถี) วิ.บุพ.กัม.วิ. อิสฺสาปกตา อิตฺถี = อิสฺสาปกตอิตฺถี ฉ.ตัป.วิ. อิสฺสาปกตอิตฺถิยา วตฺถุ = อิสฺสาปกตอิตฺถีวตฺถุ แจกเหมือน วตฺถุ",
  "อิสฺสาภิภูต": "ว. ผู้อันความริษยาครอบงำแล้ว อิต. แจกเหมือน กญฺญา เช่น ป.เอก. อิสฺสาภิภูตา (อิตฺถี) อ. หญิง ผู้อันความริษยาครอบงำแล้ว เป็นตติยาตัปปุริสสมาส วิ.ว่า อิสฺสาย อภิภูตา = อิสฺสาภิภูตา (อิตฺถี) คำว่า อภิภูต มาจาก อภิ บทหน้า + ภู ธาตุ ในความมี, ความเป็น ด้วยอำนาจ อภิ อุปสัคอยู่หน้า แปลว่า ครอบงำ + ต ปัจจัย ได้รูปเป็น อภิภูต ดู อกต",
