  "อุกฺกฏฺฐสปทานจาริโก": "ว., ปุ. (ภิกฺขุ) อ. ภิกษุ ผู้มีอันเที่ยวไปสู่ที่อันเป็นไปกับด้วยตรอก อันอุกฤษฏ์ อุกฺกฏฺฐ + สปทาน + จาร ศัพท์ + อิก ปัจจัย ในตทัสสัตถิตัทธิต ได้รูปเป็น อุกฺกฏฺฐ สปทานจาริก มีทุติยาตัปปุริสสมาส และวิเสสนบุพพบท กัมมธารยสมาส เป็นภายใน มีวิเคราะห์ ตามลำดับ ดังนี้ ทุ.ตัป.วิ. สปทานํ จาโร = สปทานจาโร วิ.บุพ.กัม.วิ. อุกฺกฏฺโฐ สปทาน จาโร = อุกฺกฏฺฐสปทานจาโร อิก.ตทัส.วิ. อุกฺกฏฺฐสปทานจาโร อสฺส อตฺถีติ อุกฺกฏฺฐสปทานจาริโก (ภิกฺขุ)",
  "อุกฺกณฺฐสิ": "ก. (ตฺวํ อ. ท่าน) ย่อมกระสันขึ้น อุ บทหน้า + กฐ ธาตุ ในความกระสัน, ความระอา + อ ปัจจัย ในกัตตุวาจก + สิ วัตตมานาวิภัตติ ซ้อน กฺ หน้า กฐ ธาตุ ลงนิคคหิตอาคมที่พยัญชนะต้นธาตุ (อุกฺกํฐ) แล้วแปลงนิคคหิต เป็น ณฺ เพราะ ฐ อยู่หลัง สำเร็จรูปเป็น อุกฺกณฺฐสิ"
