  "อุปคญฺฉิ": "ก. (เช่น เถโร อ. พระเถระ) เข้าไปจำแล้ว, เข้าไปหาแล้ว (เทวตา อ. เทวดา) เข้าสถิตแล้ว อุป บทหน้า + คม ธาตุ ในความไป, ความ ถึง มี อุป อยู่หน้า แปลว่า เข้าถึง + อ ปัจจัย ในกัตตุวาจก + อี อัชชัตตนีวิภัตติ แปลง คม ธาตุ เป็น คญฺฉ รัสสะ อี เป็น อิ สำเร็จรูปเป็น อุปคญฺฉิ"
