  "อุปนิสฺสยสมฺปนฺน": "ว. ผู้ถึงพร้อมแล้วด้วยอุปนิสัย ปุ. แจกเหมือน ปุริส เช่น ป.เอก. อุปนิสฺสย สมฺปนฺโน (กุลปุตฺโต) อ. กุลบุตร ผู้ถึงพร้อม แล้วด้วยอุปนิสัย เป็นตติยาตัปปุริสสมาส วิ.ว่า อุปนิสฺสเยน สมฺปนฺโน = อุปนิสฺสยสมฺปนฺโน (กุลปุตฺโต)",
