  "อุปนีต": "ก. อัน…นำเข้าไปแล้ว อุป บทหน้า + นี ธาตุ ในความนำไป + ต ปัจจัย ได้รูปเป็น อุปนีต ดู อกต",
  "อุปนีตวโย": "ว., ปุ. (ตฺวํ อ. ท่าน ใช้แทน พราหมณ์) ผู้มีวัยอันชรานำไปแล้ว [ธ. ๗: โคฆาตกปุตฺตวตฺถุ หน้า ๕] เป็นฉัฏฐีตุลยาธิกรณพหุพพิหิสมาส วิ.ว่า (ชราย) อุปนีโต วโย ยสฺส โส อุปนีตวโย (ตฺวํ) วัย ของท่านใด อันชรา นำไปแล้ว ท่านนั้น ชื่อว่าผู้มีวัยอันชรานำไปแล้ว",
