  "อุปปชฺชิ": "ก. (เช่น เสฏฺฐี อ. เศรษฐี) เข้าถึงแล้ว อุป บทหน้า + ปท ธาตุ ในความถึง + ย ปัจจัย ในกัตตุวาจก + อี อัชชัตตนีวิภัตติ แปลง ท กับ ย ปัจจัย เป็น ชฺช รัสสะ อี เป็น อิ สำเร็จรูปเป็น อุปปชฺชิ",
