  "อุปริเทวโลกสมฺปาปก": "ว. อันยัง...ให้ถึงพร้อมซึ่ง เทวโลกในเบื้องบน นปุ. แจกเหมือน กุล เช่น ทุ.พหุ. อุปริเทวโลกสมฺปาปกานิ (สญฺโญชนานิ) ซึ่งสังโยชน์ ท. อันยังสัตว์ให้ถึงพร้อมซึ่งเทวโลก ในเบื้องบน มาจาก อุปริเทวโลก + สํ + ป บทหน้า + อาป ธาตุ ในความถึง + ณฺวุ ปัจจัย แปลง นิคคหิตที่ สํ เป็น มฺ เพราะ ป อยู่หลัง แปลง ณฺวุ เป็น อก ได้รูปเป็น อุปริเทวโลกสมฺปาปก แปลว่า อันยัง...ให้ถึงพร้อมซึ่งเทวโลกใน เบื้องบน เป็นกัตตุรูป กัตตุสาธนะ วิ.ว่า อุปริเทวโลกํ สมฺปาเปนฺตีติ อุปริเทวโลก สมฺปาปกานิ (สญฺโญชนานิ)",
