  "อุปริปาสาท": "น., นปุ. เบื้องบนแห่งปราสาท แจกเหมือน กุล เฉพาะฝ่ายเอกวจนะ เช่น ส.เอก. อุปริปาสาเท ในเบื้องบนแห่งปราสาท เป็นนิปาต ปุพพกะ อัพยยีภาวสมาส วิ.ว่า ปาสาทสฺส อุปริ = อุปริปาสาทํ เบื้องบนแห่งปราสาท",
  "อุปริปาสาทตล": "น., นปุ. พื้นในเบื้องบนแห่ง ปราสาท แจกเหมือน กุล เช่น ส.เอก. อุปริ ปาสาทตเล ที่พื้นในเบื้องบนแห่งปราสาท เป็น สัตตมีตัปปุริสสมาส มีนิปาตปุพพกะ อัพยยีภาวสมาส เป็นภายใน มีวิเคราะห์ตามลำดับ ดังนี้ นิ.อัพ.วิ. ปาสาทสฺส อุปริ = อุปริปาสาทํ เบื้องบนแห่งปราสาท ส.ตัป.วิ. อุปริปาสาเท ตลํ = อุปริปาสาทตลํ",
