  "อุปริมกาย": "น., ปุ. พระกายอันมีในเบื้องบน แจกเหมือน ปุริส เช่น ทุ.เอก. อุปริมกายํ ซึ่งพระกายอันมีในเบื้องบน เฉพาะปัญจมีวิภัตติ ฝ่ายเอก. ลง โต ปัจจัย เป็น อุปริมกายโต แต่พระกายอันมีในเบื้องบน บ้าง เป็นวิเสสน บุพพบท กัมมธารยสมาส มี อิม ปัจจัย ในชาตาทิตัทธิต เป็นภายใน มีวิเคราะห์ตามลำดับ ดังนี้ อิม.ชาตา.วิ. อุปริ ภโว = อุปริโม (กาโย) กาย อันมี ในเบื้องบน ชื่อว่า อุปริโม ๆ อันมีในเบื้องบน [ระหว่าง อุปริ - อิม ลบสระหน้า คือ อิ ที่ ริ ต่อเป็น อุปริม] วิ.บุพ.กัม.วิ. อุปริโม กาโย = อุปริมกาโย",
  "อุปริมคฺควเสน": "น., ปุ. ด้วยสามารถแห่งมรรคใน เบื้องบน เป็นฉัฏฐีตัปปุริสสมาส มีสัตตมีตัปปุริสสมาส เป็นภายใน มีวิเคราะห์ตามลำดับ ดังนี้ ส.ตัป.วิ. อุปริ มคฺโค = อุปริมคฺโค ฉ.ตัป.วิ. อุปริ มคฺคสฺส วโส = อุปริมคฺควโส แจกเหมือน ปุริส",
  "อุปริมตล": "น., นปุ. พื้นอันมีในเบื้องบน แจกเหมือน กุล เช่น ส.เอก. อุปริมตเล ที่พื้นอันมี ในเบื้องบน เป็นวิเสสนบุพพบท กัมมธารยสมาส มี อิม ปัจจัย ในชาตาทิตัทธิต เป็นภายใน มีวิเคราะห์ตามลำดับ ดังนี้ อิม.ชาตา.วิ. อุปริ ภวํ = อุปริมํ (ตลํ) พื้น อันมี ในเบื้องบน ชื่อว่า อุปริมํ ๆ อันมีในเบื้องบน [ระหว่าง อุปริ - อิม ลบสระหน้า คือ อิ ที่ ริ ต่อเป็น อุปริม] วิ.บุพ.กัม.วิ. อุปริมํ ตลํ = อุปริมตลํ"
