  "อุปสนฺตรูป": "ว. มีรูปอันเข้าไปสงบแล้ว ปุ. แจกเหมือน ปุริส เช่น ป.พหุ. อุปสนฺตรูปา (ภิกฺขู) อ. ภิกษุ ท. ผู้มีรูปอันเข้าไปสงบแล้ว เป็นฉัฏฐีตุลยาธิกรณพหุพพิหิสมาส วิ.ว่า อุปสนฺตํ รูปํเยสํ เต อุปสนฺตรูปา (ภิกฺขู) รูป ของภิกษุ ท. เหล่าใด เข้าไปสงบแล้ว ภิกษุ ท. เหล่านั้น ชื่อว่าผู้มีรูปอันเข้าไปสงบแล้ว",
